According to D3 [API Reference](https://github.com/mbostock/d3/wiki/Selections#classed):

> If value is not specified, returns true if and only if the first non-null element in this selection has the specified class. This is generally useful only if you know the selection contains exactly one element.

And its [implementation](https://github.com/mbostock/d3/blob/master/d3.js#L685) actually only returns boolean:

``` javascript
 d3_selectionPrototype.classed = function(name, value) {
    if (arguments.length < 2) {
      if (typeof name === "string") {
        var node = this.node(), n = (name = d3_selection_classes(name)).length, i = -1;
        if (value = node.classList) {
          while (++i < n) if (!value.contains(name[i])) return false;
        } else {
          value = node.getAttribute("class");
          while (++i < n) if (!d3_selection_classedRe(name[i]).test(value)) return false;
        }
        return true;
      }
      // ...
```

Fix signatures of `D3.ForceLayout.size`:
1. It returns the current size as number array if no argument is supplied.
2. It cannot accept a function as size accessor.

See [API Reference](https://github.com/mbostock/d3/wiki/Force-Layout#size):

> If size is specified, sets the available layout size to the specified two-element array of numbers representing x and y. If size is not specified, returns the current size, which defaults to 1×1.

And source code for [definition](https://github.com/mbostock/d3/blob/v3.5.5/d3.js#L6300):

``` JS
    force.size = function(x) {
      if (!arguments.length) return size;
      size = x;
      return force;
    };
```

and [initialization](https://github.com/mbostock/d3/blob/v3.5.5/d3.js#L6208):

``` JS
size = [ 1, 1 ]
```

