Basic objective is to support: 

``` ts
import angular = require('angular');
var myMod: angular.IModule = angular.module(...);

// and maintain backward compatibility: 
var myMod2: ng.IModule;
myMod2 = myMod;
```

This does break backward compatibilty if user does `declare module ng` or `module ng`.

They should update all to `module angular`. 

Note: This backward compatibility might be restored with TypeScript 1.5
